(function execute(inputs, outputs) {
var healthDetails=inputs.question.healthDetails;

var gr = new GlideRecord('x_rptp_smartinte_0_integration_question_configuration');
var arr = [];
gr.addQuery('insurer', '9907033affc3c29019a8ffda7c4fd95d');
gr.query();
while (gr.next()) {
    if(gr.getValue('code')){
    var obj = {
        insuranceCategory: gr.getDisplayValue('insurance_category'),
        insurer: gr.getDisplayValue('insurer'),
        questionCategory: gr.getDisplayValue('question_category'),
        product: gr.getDisplayValue('product'),
        code: gr.getValue('code'),
        answer: gr.getValue('answer_number'),
        question: gr.getValue('question'),
        id: gr.getValue('question_id'),
        subid: gr.getValue('sub_question_id')
    };
    arr.push(obj);
    }
}
 
var balicArray=[]
 
function filterByCode(arr, code) {
  return arr.filter(function(ques) {
    return ques.code === code;
  });
}

healthDetails=(healthDetails.concat(inputs.question.nri));
healthDetails.forEach(function(question){
     var res=filterByCode(arr,question.code)
 
 var qCat="";
var result="";
var qID="";
var sQID=""
  res.forEach(function(resp){
    qID=resp.id 
    sQID=resp.subid
    qCat=resp.questionCategory;


  if(resp.answer!="answer1" && question[resp.answer]!=""){
   

  result+=question[resp.answer]+",";
  }
  });
  var string5="";
  var string6=qCat;

   if(qCat=="NRI Questionnaire"){
    string6="NRI";
    var nri=question.code.split("_")||[];
    if(nri.length==2){
      if(nri[1]=="P"){
        string5="2";


      }
      else if(nri[1]=="L"){
        string5="1";

      }
    }
    else if(nri.length==1){
      string5="1";

    }

   }
         var obj={
        "stringval1":qID||"",
        "stringval2":sQID||"",
        "stringval3":question.answer1||"",
        "stringval4":result||"",
        "stringval5":string5||"",
        "stringval6":string6||""
     }
     if(qID)
     balicArray.push(obj);  
})
outputs.response = {
  WeoRecStrings150User:balicArray
};
})(inputs, outputs);

